sap.ui.define(["Project/Project/model/invoicePriceFormatter"],function(e){"use strict";QUnit.module("Számla részösszeg számítás");function s(s){var t=e.invoicePrice(s.fValue,s.fQuantity);s.assert.strictEqual(t,s.expected,"Az állapot helyes volt.")}QUnit.test("Az árat (egész szám) szükséges összeszorozni a mennyiséggel (egész szám): (1500 * 2 = 3000)",function(e){s.call(this,{assert:e,fValue:1500,fQuantity:2,expected:3e3})});QUnit.test("Az árat (nem egész szám) szükséges összeszorozni a mennyiséggel (egész szám): (543.21 * 3 = 1629.63)",function(e){s.call(this,{assert:e,fValue:543.21,fQuantity:3,expected:1629.63})})});